            {" "}
            <img src={HAIR2} alt="" />
          </div>
          <div class="swiper-slide">
            {" "}
            <img src={HAIR3} alt="" />
          </div>
          <div class="swiper-slide">
            {" "}
            <img src={HAIR4} alt="" />
          </div>
          <div class="swiper-slide">
